using System.Text.Json;

using DotLiquid;

namespace ShareLoc.Server.App.Pages;

public sealed class GuessingPage : Page
{
	private const string CookieGuessserId = "guesserId";

	public override void MapEndpoints(WebApplication app)
	{
		app.MapGet("/{placeId:guid}", (Guid placeId, HttpContext context) =>
		{
			string? jsonGuess = null;
			if (context.Request.Cookies.TryGetValue(CookieGuessserId, out var guesserId))
			{
				//TODO try retrieve guess

				if (Random.Shared.NextDouble() > 0.5)
				{
					var guess = new
					{
						guessLatitude = Random.Shared.NextDouble() * 180 - 90,
						guessLongitude = Random.Shared.NextDouble() * 360 - 180,
						score = Random.Shared.Next(0, 10000),
						correctLatitude = 49.22683575036142,
						correctLongitude = 16.596832726383212,
					};

					jsonGuess = JsonSerializer.Serialize(guess);
				}
			}
			else
			{
				context.Response.Cookies.Append(CookieGuessserId, Guid.NewGuid().ToString());
			}

			//TODO retrieve place
			var img = "";

			var parameters = Hash.FromAnonymousObject(new
			{
				placeId = placeId,
				text = "Can you guess where I am?!",
				base64Image = img,
				myGuessInfo = jsonGuess
			});

			return Results.Text(Render(parameters), "text/html");
		});
	}
}
